import React from 'react'

const Userpage = () => {
  return (
	<div>
		<form>
			<label></label>
			<input type="recipient_email" placeholder="recipient email"></input>
			<input type="message" placeholder="email message"></input>
		</form>
	</div>
  )
}

export default Userpage
